INSERT INTO `spell_script_names` (`spell_id`, `ScriptName`) VALUES ('52708', 'spell_boss_salramm_steal_flesh');
INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `BroadcastTextID`, `comment`) VALUES
('26497', '0', '0', 'Arthas! You can\'t just--', '12', '0', '100', '0', '0', '12837', '27326', 'culling SAY_PHASE113'),
('26497', '1', '0', 'I\'m sorry, Arthas. I can\'t watch you do this.', '12', '0', '100', '0', '0', '12838', '27330', 'culling SAY_PHASE117'),
('26499', '0', '0', 'Glad you could make it, Uther.', '12', '0', '100', '0', '0', '12828', '27314', 'culling SAY_PHASE101'),
('26499', '1', '0', 'As if I could forget. Listen, Uther, there\'s something about the plague you should know...', '12', '0', '100', '0', '0', '12829', '27316', 'culling SAY_PHASE103'),
('26499', '2', '0', 'Oh, no. We\'re too late. These people have all been infected! They may look fine now, but it\'s just a matter of time before they turn into the undead!', '12', '0', '100', '0', '0', '12830', '27317', 'culling SAY_PHASE104'),
('26499', '3', '0', 'This entire city must be purged.', '12', '0', '100', '0', '0', '12831', '27319', 'culling SAY_PHASE106'),
('26499', '4', '0', 'Damn it, Uther! As your future king, I order you to purge this city!', '12', '0', '100', '0', '0', '12832', '27321', 'culling SAY_PHASE108'),
('26499', '5', '0', 'Then I must consider this an act of treason.', '12', '0', '100', '0', '0', '12833', '27323', 'culling SAY_PHASE110'),
('26499', '6', '0', 'Have I? Lord Uther, by my right of succession and the sovereignty of my crown, I hereby relieve you of your command and suspend your paladins from service.', '12', '0', '100', '0', '0', '12834', '27325', 'culling SAY_PHASE112'),
('26499', '7', '0', 'It\'s done! Those of you who have the will to save this land, follow me! The rest of you... get out of my sight!', '12', '0', '100', '0', '0', '12835', '27327', 'culling SAY_PHASE114'),
('26499', '8', '0', 'Jaina?', '12', '0', '100', '0', '0', '12836', '27329', 'culling SAY_PHASE116'),
('26499', '9', '0', 'Take position here, and I will lead a small force inside Stratholme to begin the culling. We must contain and purge the infected for the sake of all of Lordaeron!', '14', '0', '100', '0', '0', '14327', '27466', 'culling SAY_PHASE118'),
('26499', '10', '0', 'Everyone looks ready. Remember, these people are all infected with the plague and will die soon. We must purge Stratholme to protect the remainder of Lordaeron from the Scourge. Let\'s go.', '12', '0', '100', '0', '0', '14293', '27535', 'culling SAY_PHASE201'),
('26499', '11', '0', 'I can only help you with a clean death.', '12', '0', '100', '0', '0', '14294', '27548', 'culling SAY_PHASE203'),
('26499', '12', '0', 'That was just the beginning.', '12', '0', '100', '0', '0', '14295', '27553', 'culling SAY_PHASE205'),
('26499', '13', '0', 'I won\'t allow it, Mal\'Ganis! Better that these people die by my hand than serve as your slaves in death!', '14', '0', '100', '0', '0', '14296', '27577', 'culling SAY_PHASE208'),
('26499', '14', '0', 'Mal\'ganis will send out some of his Scourge minions to interfere with us. Those of you with the strongest steel and magic shall go forth and destroy them. I will lead the rest of my forces in purging Stratholme of the infected.', '14', '0', '100', '0', '0', '14885', '27584', 'culling SAY_PHASE209'),
('26499', '15', '0', 'Champions, meet me at the Town Hall at once. We must take the fight to Mal\'Ganis.', '14', '0', '100', '0', '0', '14297', '28890', 'culling SAY_PHASE210'),
('26499', '16', '0', 'Follow me, I know the way through.', '12', '0', '100', '0', '0', '14298', '27800', 'culling SAY_PHASE301'),
('26499', '17', '0', 'Yes, I\'m glad I could get to you before the plague.', '12', '0', '100', '0', '0', '14299', '27812', 'culling SAY_PHASE303'),
('26499', '18', '0', 'What is this sorcery?', '12', '0', '100', '0', '0', '14300', '27814', 'culling SAY_PHASE304'),
('26499', '19', '0', 'Mal\'Ganis appears to have more than scourge in his arsenal. We should make haste.', '12', '0', '100', '0', '0', '14301', '27840', 'culling SAY_PHASE306. NEEDS VERIFICATION'),
('26499', '20', '0', 'More vile sorcery! Be ready for anything!', '12', '0', '100', '0', '0', '14302', '27882', 'culling SAY_PHASE307'),
('26499', '21', '0', 'Let\'s move on.', '12', '0', '100', '0', '0', '14303', '36010', 'culling SAY_PHASE308'),
('26499', '22', '0', 'Watch your backs: they have us surrounded in this hall.', '12', '0', '100', '0', '0', '14304', '27901', 'culling SAY_PHASE309'),
('26499', '23', '0', 'One less obstacle to deal with.', '12', '0', '100', '0', '0', '0', '31356', 'culling SAY_PHASE310. NEEDS VERIFICATION'),
('26499', '24', '0', 'Mal\'Ganis is not making this easy.', '12', '0', '100', '0', '0', '14305', '27902', 'culling SAY_PHASE311'),
('26499', '25', '0', 'They\'re very persistent.', '12', '0', '100', '0', '0', '14306', '27904', 'culling SAY_PHASE312'),
('26499', '26', '0', 'What else can he put in my way?', '12', '0', '100', '0', '0', '14307', '27905', 'culling SAY_PHASE313'),
('26499', '27', '0', 'I do what I must for Lordaeron, and neither your words nor your actions will stop me.', '12', '0', '100', '0', '0', '14309', '27916', 'culling SAY_PHASE315'),
('26499', '28', '0', 'The quickest path to Mal\'Ganis lies behind that bookshelf ahead.', '12', '0', '100', '0', '0', '14308', '27906', 'culling SAY_PHASE401'),
('26499', '29', '0', 'This will only take a moment.', '12', '0', '100', '0', '0', '14310', '28040', 'culling SAY_PHASE402'),
('26499', '30', '0', 'I\'m relieved this secret passage still works.', '12', '0', '100', '0', '0', '14311', '28041', 'culling SAY_PHASE403'),
('26499', '31', '0', 'Let\'s move through here as quickly as possible. If the undead don\'t kill us, the fires might.', '12', '0', '100', '0', '0', '14312', '28562', 'culling SAY_PHASE404'),
('26499', '32', '0', 'Rest a moment and clear your lungs, but we must move again soon.', '12', '0', '100', '0', '0', '14313', '28045', 'culling SAY_PHASE405'),
('26499', '33', '0', 'That\'s enough, we must move again. Mal\'Ganis awaits.', '12', '0', '100', '0', '0', '14314', '28047', 'culling SAY_PHASE406'),
('26499', '34', '0', 'At last some good luck. Market Row has not caught fire yet. Mal\'Ganis is supposed to be in Crusaders\' Square, which is just ahead. Tell me when you\'re ready to move forward.', '12', '0', '100', '0', '0', '14315', '28048', 'culling SAY_PHASE407'),
('26499', '35', '0', 'Justice will be done.', '12', '0', '100', '0', '0', '14316', '28563', 'culling SAY_PHASE501'),
('26499', '36', '0', 'We\'re going to finish this right now, Mal\'Ganis. Just you... and me.', '12', '0', '100', '0', '0', '14317', '28520', 'culling SAY_PHASE502'),
('26499', '37', '0', 'I\'ll hunt you to the ends of the earth if I have to! Do you hear me? To the ends of the earth!', '12', '0', '100', '0', '0', '14318', '28529', 'culling SAY_PHASE503'),
('26499', '38', '0', 'You performed well this day. Anything that Mal\'Ganis has left behind is yours. Take it as your reward. I must now begin plans for an expedition to Northrend.', '12', '0', '100', '0', '0', '14319', '28530', 'culling SAY_PHASE504'),
('26499', '39', '0', 'I can\'t afford to spare you.', '12', '0', '100', '0', '0', '14323', '31355', ''),
('26527', '0', '0', 'Oh, no! Adventurers, something awful has happened! A colleague of mine has been captured by the Infinite Dragonflight, and they\'re doing something horrible to him! Keeping Arthas is still your highest priority, but if you act fast you could help save a Guardian of Time!', '15', '0', '100', '0', '0', '0', '32670', 'Chromie'),
('26527', '1', '0', 'Adventurers, you must hurry! The Guardian of Time cannot last for much longer!', '15', '0', '100', '0', '0', '0', '32678', 'Chromie'),
('26527', '2', '0', 'I can barely sense the Guardian of Time! His timeline is fading quickly!', '15', '0', '100', '0', '0', '0', '32679', 'Chromie'),
('26528', '0', '0', 'Watch your tone with me, boy. You may be the prince, but I\'m still your superior as a paladin!', '12', '0', '100', '0', '0', '12839', '27315', 'culling SAY_PHASE102'),
('26528', '1', '0', 'What?', '12', '0', '100', '0', '0', '12840', '38871', 'culling SAY_PHASE105'),
('26528', '2', '0', 'How can you even consider that? There\'s got to be some other way.', '12', '0', '100', '0', '0', '12841', '27320', 'culling SAY_PHASE107'),
('26528', '3', '0', 'You are not my king yet, boy! Nor would I obey that command even if you were!', '12', '0', '100', '0', '0', '12842', '27322', 'culling SAY_PHASE109'),
('26528', '4', '0', 'Treason? Have you lost your mind, Arthas?', '12', '0', '100', '0', '0', '12843', '27324', 'culling SAY_PHASE111'),
('26528', '5', '0', 'You\'ve just crossed a terrible threshold, Arthas.', '12', '0', '100', '0', '0', '12844', '27328', 'culling SAY_PHASE115'),
('26529', '0', '0', 'Play time!', '14', '0', '100', '0', '0', '13428', '27716', 'meathook SAY_AGGRO'),
('26529', '1', '0', 'Boring...', '14', '0', '100', '0', '0', '13430', '29943', 'meathook SAY_SLAY_1'),
('26529', '1', '1', 'Why you stop moving?', '14', '0', '100', '0', '0', '13431', '29944', 'meathook SAY_SLAY_2'),
('26529', '1', '2', 'Get up! Me not done!', '14', '0', '100', '0', '0', '13432', '29945', 'meathook SAY_SLAY_3'),
('26529', '2', '0', 'New toys!', '14', '0', '100', '0', '0', '13429', '29942', 'meathook SAY_SPAWN'),
('26529', '3', '0', 'This... not fun...', '14', '0', '100', '0', '0', '13433', '29941', 'meathook SAY_DEATH'),
('26530', '0', '0', 'Ah, the entertainment has arrived!', '14', '0', '100', '0', '0', '13472', '29947', 'salramm SAY_AGGRO'),
('26530', '1', '0', 'You are too late, champion of Lordaeron. The dead shall have their day.', '14', '0', '100', '0', '0', '13471', '27717', 'salramm SAY_SPAWN'),
('26530', '2', '0', 'The fun is just beginning!', '14', '0', '100', '0', '0', '13473', '29948', 'salramm SAY_SLAY_1'),
('26530', '2', '1', 'Aah, quality materials!', '14', '0', '100', '0', '0', '13474', '29949', 'salramm SAY_SLAY_2'),
('26530', '2', '2', 'Don\'t worry, I\'ll make good use of you.', '14', '0', '100', '0', '0', '13475', '29950', 'salramm SAY_SLAY_3'),
('26530', '3', '0', 'You only advance... the master\'s plan...', '14', '0', '100', '0', '0', '13483', '29946', 'salramm SAY_DEATH'),
('26530', '4', '0', 'BOOM! Hahahahah...', '14', '0', '100', '0', '0', '13478', '29953', 'salramm SAY_EXPLODE_GHOUL_1'),
('26530', '4', '1', 'Blood... destruction... EXHILARATING!', '14', '0', '100', '0', '0', '13479', '29954', 'salramm SAY_EXPLODE_GHOUL_2'),
('26530', '5', '0', 'I want a sample...', '14', '0', '100', '0', '0', '13480', '29955', 'salramm SAY_STEAL_FLESH_1'),
('26530', '5', '1', 'Such strength... it must be mine!', '14', '0', '100', '0', '0', '13481', '29956', 'salramm SAY_STEAL_FLESH_2'),
('26530', '5', '2', 'Your flesh betrays you.', '14', '0', '100', '0', '0', '13482', '29957', 'salramm SAY_STEAL_FLESH_3'),
('26530', '6', '0', 'Say hello to some friends of mine.', '14', '0', '100', '0', '0', '13476', '29951', 'salramm SAY_SUMMON_GHOULS_1'),
('26530', '6', '1', 'Come, citizen of Stratholme! Meet your saviors.', '14', '0', '100', '0', '0', '13477', '29952', 'salramm SAY_SUMMON_GHOULS_2'),
('26532', '0', '0', 'Prince Arthas Menethil, on this day, a powerful darkness has taken hold of your soul. The death you are destined to visit upon others will this day be your own.', '14', '0', '100', '0', '0', '13408', '27911', 'epoch SAY_INTRO | culling SAY_PHASE314'),
('26532', '1', '0', 'We\'ll see about that, young prince.', '14', '0', '100', '0', '0', '13409', '27920', 'epoch SAY_AGGRO'),
('26532', '2', '0', 'Tick tock, tick tock...', '14', '0', '100', '0', '0', '13410', '30451', 'epoch SAY_TIME_WARP_1'),
('26532', '2', '1', 'Not quick enough!', '14', '0', '100', '0', '0', '13411', '30452', 'epoch SAY_TIME_WARP_2'),
('26532', '2', '2', 'Let\'s get this over with. ', '14', '0', '100', '0', '0', '13412', '30453', 'epoch SAY_TIME_WARP_3'),
('26532', '3', '0', 'There is no future for you.', '14', '0', '100', '0', '0', '13413', '30454', 'epoch SAY_SLAY_1'),
('26532', '3', '1', 'This is the hour of our greatest triumph!', '14', '0', '100', '0', '0', '13414', '30455', 'epoch SAY_SLAY_2'),
('26532', '3', '2', 'You were destined to fail.', '14', '0', '100', '0', '0', '13415', '30456', 'epoch SAY_SLAY_3'),
('26532', '4', '0', '*gurgles*', '16', '0', '100', '0', '0', '13416', '0', 'epoch SAY_DEATH'),
('26533', '0', '0', 'Yes, this is the beginning. I\'ve been waiting for you, young prince. I am Mal\'Ganis.', '14', '0', '100', '0', '0', '14410', '27574', 'malganis SAY_INTRO_1 | culling SAY_PHASE206'),
('26533', '1', '0', 'As you can see, your people are now mine. I will now turn this city household by household, until the flame of life has been snuffed out... forever.', '14', '0', '100', '0', '0', '14411', '27575', 'malganis SAY_INTRO_2 | culling SAY_PHASE207'),
('26533', '2', '0', 'This will be a fine test...Prince Arthas...', '14', '0', '100', '0', '0', '14413', '31344', 'malganis SAY_AGGRO'),
('26533', '3', '0', 'All too easy...', '14', '0', '100', '0', '0', '14416', '31347', 'malganis SAY_KILL_1'),
('26533', '3', '1', 'The dark lord is displeased with your interference...', '14', '0', '100', '0', '0', '14417', '31348', 'malganis SAY_KILL_2'),
('26533', '3', '2', 'It is Prince Arthas I want... not you...', '14', '0', '100', '0', '0', '14418', '31349', 'malganis SAY_KILL_3'),
('26533', '4', '0', 'Anak\'Keri...', '14', '0', '100', '0', '0', '14422', '30412', 'malganis SAY_SLAY_1'),
('26533', '4', '1', 'My onslaught will wash over the Lich King\'s forces...', '14', '0', '100', '0', '0', '14423', '30413', 'malganis SAY_SLAY_2'),
('26533', '4', '2', 'Your death is in vain, tiny mortal...', '14', '0', '100', '0', '0', '14424', '30414', 'malganis SAY_SLAY_3'),
('26533', '4', '3', 'Your time has come to an end!', '14', '0', '100', '0', '0', '14425', '30415', 'malganis SAY_SLAY_4'),
('26533', '5', '0', 'Time out...', '14', '0', '100', '0', '0', '14414', '31345', 'malganis SAY_SLEEP_1'),
('26533', '5', '1', 'You seem...tired...', '14', '0', '100', '0', '0', '14415', '31346', 'malganis SAY_SLEEP_2'),
('26533', '6', '0', 'I spent too much time in that weak little shell...', '14', '0', '100', '0', '0', '14426', '30275', 'malganis SAY_30HEALTH'),
('26533', '7', '0', '(Eredun) I AM MAL\'GANIS! I AM ETERNAL!', '14', '0', '100', '0', '0', '14427', '30276', 'malganis SAY_15HEALTH'),
('26533', '8', '0', 'ENOUGH! I waste my time here...I must gather my strength on the home world...', '14', '0', '100', '0', '0', '14428', '30277', 'malganis SAY_ESCAPE_SPEECH_1'),
('26533', '9', '0', 'You\'ll never defeat the Lich King without my forces! I\'ll have my revenge...on him, AND you...', '14', '0', '100', '0', '0', '14429', '30278', 'malganis SAY_ESCAPE_SPEECH_2'),
('26533', '10', '0', 'Your journey has just begun, young prince. Gather your forces and meet me in the artic land of Northrend. It is there that we shall settle the score between us. It is there that your true destiny will unfold.', '14', '0', '100', '0', '0', '14412', '28528', 'malganis SAY_OUTRO'),
('27915', '0', '0', 'Good work with the crates! Come talk to me in front of Stratholme for your next assignment!', '15', '0', '0', '0', '0', '0', '30509', 'Chromie - SAY_EVENT_START'),
('27915', '1', '0', 'Adventurers you must hurry! The Guardian of Time cannot last for much longer!', '15', '0', '0', '0', '0', '0', '32678', 'Chromie - SAY_EVENT_TIME_GUARDIAN_FADING'),
('27915', '2', '0', 'I can barely sense the Guardian of Time! His timeline if fading quickly!', '15', '0', '0', '0', '0', '0', '32679', 'Chromie - SAY_EVENT_TIME_GUARDIAN_FADING'),
('28167', '0', '0', 'Prince Arthas, may the light be praised! Many people in the town have begun to fall seriously ill, can you help us?', '12', '0', '100', '0', '0', '0', '27547', 'culling SAY_PHASE202'),
('28169', '0', '0', 'What? This can\'t be!', '12', '0', '100', '0', '0', '0', '27549', 'culling SAY_PHASE204'),
('28169', '0', '1', 'Oh, no...', '12', '0', '100', '0', '0', '0', '27552', ''),
('31126', '0', '0', 'Ah, you\'ve finally arrived Prince Arthas. You\'re here just in the nick of time.', '12', '0', '100', '0', '0', '0', '27811', 'culling SAY_PHASE302'),
('31126', '1', '0', 'There\'s no need for you to understand, Arthas. All you need to do is die.', '12', '0', '100', '0', '0', '0', '27815', 'culling SAY_PHASE305'),
('32273', '0', '0', 'How dare you interfere with our work!', '14', '0', '100', '0', '0', '0', '32639', 'Infinite Corruptor - SAY_AGGRO'),
('32273', '1', '0', 'My time... has run out...', '14', '0', '100', '0', '0', '0', '32642', 'Infinite Corruptor - SAY_DEATH'),
('32273', '2', '0', 'The process is finally complete! My work here is done.', '14', '0', '100', '0', '0', '0', '32666', 'Infinite Corruptor - SAY_FAIL');
